function make_newform();
 M := HilbertCuspForms(F, NN);
 S := NewSubspace(M);
 // SetVerbose("ModFrmHil", 1);
 NFD := NewformDecomposition(S);
 newforms := [* Eigenform(U) : U in NFD *];

